const app = getApp()

Page({
  data: {
    userInfo:undefined,
    remainTicketAmount:11,
    itemList:[
      {id:1,name:'ps 5',amount:2,imgurl:'data:image/jpeg;base64,'},
      {id:2,name:'ps 5',amount:2,imgurl:'data:image/jpeg;base64,'},
      {id:3,name:'ps 5',amount:2,imgurl:'data:image/jpeg;base64,'},
      {id:4,name:'ps 5',amount:2,imgurl:'data:image/jpeg;base64,'},
      {id:5,name:'ps 5',amount:2,imgurl:'data:image/jpeg;base64,'},
      {id:6,name:'ps 5',amount:2,imgurl:'data:image/jpeg;base64,'},
      {id:7,name:'ps 5',amount:2,imgurl:'data:image/jpeg;base64,'},
    ],
    betList:{}
  },
  bet:function(event){
    let betList = this.data.betList;
    let betId = event.target.dataset['bet'].id
    if(betList[betId]){
      betList[betId] += 1
    }else{
      betList[betId] = 1
    }
    this.setData({
      remainTicketAmount: this.data.remainTicketAmount - 1,
      betList:betList,
    })
  },
  clearBet:function(){
    this.setData({
      betList:{},
      remainTicketAmount:11,
    })
  },
  getUserInfo: function (){
    var that = this;
    tt.getUserInfo({
      success (res) {
        console.log(res)
        that.setData({
          userInfo:res.userInfo
        },()=>{
          that.showWelcome()
        })
      },
      fail(res){
        console.log('fail to get userinfo')
      }
    })
  },
  onLoad: function () {
    let userInfo = tt.getStorageSync('userInfo')
    this.setData({
      userInfo:userInfo,
    })
    if(this.data.userInfo.nickName){
      this.showWelcome()
    }else{
      this.getUserInfo();
    }
  },
  showWelcome: function () {
    tt.showToast({
      title:`Welcome to Balcklake Casino,${this.data.userInfo.nickName}`,
      icon:'none',
      duration:2000,
    })
  }
})
